<style>
body{margin:0; width:100%; background: #51aea6;}

.sp-input,
.sp-palette-toggle{display: inline-block;}

.controls {
  display: block;
  margin-left: 5px;
  width: 100%;
}
.controls .control-row {
  display: flex;
  flex-wrap: wrap;
  justify-content: flex-start;
  padding: 5px 2px;
}
.controls input, .controls select, .controls label {
  color: #3d3d3d;
  font-family: Lato, sans-serif;
  font-size: 16px;
  padding: 5px;
}
.controls input[type=number] {
  width: 30px;
}

.results-container {
  width: 100%;
  padding:0px;
}

.date{
 position: absolute;
 bottom: 30px;
 right: 30px;
 font-family: 'Rancho';
 font-weight: 400;
 color: white;
 font-size: 3.5em;
 z-index: 9999;
 }


input[type=checkbox] + label {
  display: inline-block;
  margin: 0em;
  cursor: pointer;
  padding: 0 1em 0 1em;
}
input[type=checkbox] {
  display: none;
}
input[type=checkbox] + label:before {
  content: "\2714";
  border: 0.1em solid black;
  border-radius: 50%;
  display: inline-block;
  width: 1.5em;
  height: 1.5em;
  font-size: 1.5em ! important;
  padding: 0 0 0.3em 0.2em;
  margin-right: 0;
  vertical-align: center;
  color: transparent;
  transition: .3s;
}
input[type=checkbox]:checked + label:before {
  background-color: MediumSeaGreen;
  border: 2px dotted red;
  color: white;
}
label{
font-size: 1.8em ! important;
font-weight: bold;
}

*, *:before, *:after {
  box-sizing: border-box;
}

.range-slider {
  margin: 0px 0 0 0%;
}

.range-slider {
  width: 80%;
}

.range-slider__range {
  -webkit-appearance: none;
  width: calc(100% - (73px));
  height: 10px;
  border-radius: 5px;
  background: #d7dcdf;
  outline: none;
  padding: 0;
  margin: 0;
}
.range-slider__range::-webkit-slider-thumb {
  -webkit-appearance: none;
          appearance: none;
  width: 40px;
  height: 40px;
  border: 2px solid red;
  border-radius: 50%;
  background: #2c3e50;
  cursor: pointer;
  -webkit-transition: background 0.15s ease-in-out;
  transition: background 0.15s ease-in-out;
}
.range-slider__range::-webkit-slider-thumb:hover {
  background: #1abc9c;
}
.range-slider__range:active::-webkit-slider-thumb {
  background: #1abc9c;
}
.range-slider__range::-moz-range-thumb {
  width: 20px;
  height: 20px;
  border: 0;
  border-radius: 50%;
  background: #2c3e50;
  cursor: pointer;
  -moz-transition: background 0.15s ease-in-out;
  transition: background 0.15s ease-in-out;
}
.range-slider__range::-moz-range-thumb:hover {
  background: #1abc9c;
}
.range-slider__range:active::-moz-range-thumb {
  background: #1abc9c;
}
.range-slider__range:focus::-webkit-slider-thumb {
  box-shadow: 0 0 0 3px #fff, 0 0 0 6px #1abc9c;
}

.range-slider__value {
  display: inline-block;
  position: relative;
  width: 60px;
  color: #fff;
  line-height: 20px;
  text-align: center;
  border-radius: 3px;
  background: #2c3e50;
  padding: 5px 10px;
  margin-left: 8px;
}
.range-slider__value:after {
  position: absolute;
  top: 8px;
  left: -7px;
  width: 0;
  height: 0;
  border-top: 7px solid transparent;
  border-right: 7px solid #2c3e50;
  border-bottom: 7px solid transparent;
  content: "";
}

::-moz-range-track {
  background: #d7dcdf;
  border: 0;
}

input::-moz-focus-inner,
input::-moz-focus-outer {
  border: 0;
}
</style>

  <script>
class ButtonGen {
  constructor(config) {
    const
    defaults = config || new Map([
    ['color', '#14989f'],
    ['border-radius', '5'],
    ['font', 'Rancho'],
    ['font-size', '6'],
    ['alignment', 'center'],
    ['type', 'var(--color)'],
    ['link', 'm.jpg'],
    ['tags', 'h3'],
    ['bottom', '360'],
    ['right', '250'],
    ['text', 'Asriva Alam'],
    ['href', '#'],
    ['background-color', '#2b3138']]);

    this.fields = [];
    this.initSpectrum();
    this.loadDefaults(defaults);
    this.bindEvents();
    this.generate();
  }

  spectrumConfigGen(color) {
    return {
      color,
      showInput: true,
      preferredFormat: 'hex',
      change: () => {this.generate();} };

  }

  initSpectrum(spectrumInputs = ['color', 'background-color']) {
    this.spectrumTargets = [];
    spectrumInputs.forEach(id => {
      this.spectrumTargets.push(id);
      $('#' + id).spectrum(this.spectrumConfigGen('black'));
    });
  }

  loadDefaults(config) {
    for (const [key, value] of config.entries()) {
      const target = $('#' + key);
      target.on('change', () => {this.generate();});
      this.fields.push(target);
      if (this.spectrumTargets.includes(key)) {
        target.spectrum('set', value);
      } else {
        target.val(value);
      }
    }
  }

  generate() {
    let results = {};
    this.fields.forEach($field => {
      results[$field.attr('id')] = $field.val();
    });

<script>

<script>
// I've added annotations to make this easier to follow along at home. Good luck learning and check out my other pens if you found this useful


// First let's set the colors of our sliders
const settings={
  fill: '#bc801a',
  background: '#d7dcdf'
}

// First find all our sliders
const sliders = document.querySelectorAll('.range-slider');

// Iterate through that list of sliders
// ... this call goes through our array of sliders [slider1,slider2,slider3] and inserts them one-by-one into the code block below with the variable name (slider). We can then access each of wthem by calling slider
Array.prototype.forEach.call(sliders,(slider)=>{
  // Look inside our slider for our input add an event listener
//   ... the input inside addEventListener() is looking for the input action, we could change it to something like change
  slider.querySelector('input').addEventListener('input', (event)=>{
    // 1. apply our value to the span
    slider.querySelector('span').innerHTML = event.target.value;
    // 2. apply our fill to the input
    applyFill(event.target);
  });
  // Don't wait for the listener, apply it now!
  applyFill(slider.querySelector('input'));
});

// This function applies the fill to our sliders by using a linear gradient background
function applyFill(slider) {
  // Let's turn our value into a percentage to figure out how far it is in between the min and max of our input
  const percentage = 100*(slider.value-slider.min)/(slider.max-slider.min);
  // now we'll create a linear gradient that separates at the above point
  // Our background color will change here
  const bg = `linear-gradient(90deg, ${settings.fill} ${percentage}%, ${settings.background} ${percentage+0.1}%)`;
  slider.style.background = bg;
}
</script>
